import styled from "styled-components";

export const Card = styled.div`
  height: 100%;
  width: 100%;

  border-radius: 10px;

  background-color: #e7ffe6;

  box-shadow: 0px 5px 20px rgb(71, 71, 71);

  align-items: center;
  position: relative;
  display: inline-block;

  curser: pointer;
  transition: transform 300ms ease-in-out;
`;

export default Card;
